import AppointmentList from "./AppointmentList";
import TableRow from '@mui/material/TableRow';
import TableCell from '@mui/material/TableCell';

function AppointmentRow({ appointment }) {
  function handleDetailsClick() {}

  function handleDeleteClick() {}

  return (

    <TableRow>
      <TableCell align="right"></TableCell>
      <TableCell>{appointment.doctor.doctor_lastname}</TableCell>
      <TableCell>{appointment.patient.patient_lastname}</TableCell>
      <TableCell>{appointment.appointment_date}</TableCell>
      <TableCell>{appointment.appointment_duration} minutes</TableCell>
      <TableCell>
        <button type="button" className="button-primary" onClick={handleDetailsClick}>
          Details
        </button>

        <button type="button" className="button" onClick={handleDeleteClick}>
          X
        </button>
      </TableCell>





    </TableRow>


  );
}

export default AppointmentRow;
